import React from "react"
import ReactDOM from "react-dom"
import { createRoot } from 'react-dom/client';

const navbar = (
    <nav>
        <h1>Bob's Bistro</h1>
        <ul>
            <li>Menu</li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>
)

//ReactDOM.render(navbar, document.getElementById("root"))

const root = createRoot(document.getElementById("root"))

root.render(navbar)
